background: transparent;
border-bottom: 2px solid black;
position: absolute;
right: 0px;
width: 20%;
margin: 37px 0px;

`;
export const FavButton = styled.button`
display: block;
width: 100%;
height: 45px;
font-size: 16px;
border-top: 2px solid black;
border-left: 2px solid black;
text-align: center;

`;

export const CustomExport = styled.button`
width: 100%;
height: 45px;
font-size: 16px;
border-top: 2px solid black;
border-bottom: 1px solid black;
border-left: 2px solid black;
text-align: center;

`;

const sendFavGraph = (rides, stats) => {
  Axios.post('http://localhost:3001/favGraph', {

    rides: rides,
    stats: stats

    }).then(() =>{
    alert('successful insert');

})
}

const FavoriteBar = () => {
    const [showModal, setShowModal] = useState(false);

    const openModal = () => {
      setShowModal(prev => !prev);
    };

    return (
        <>
        <SideNav>
        <FavButton onClick={() => sendFavGraph(saveLists().rideList, saveLists().statList)
        }> My Favorite1</FavButton>
           <FavButton>My Favorite2 </FavButton>
           <FavButton>My Favorite3</FavButton>
           <FavButton>My Favorite4</FavButton>
           <CustomExport>Custom Export</CustomExport>
        </SideNav>
        </>
    )

}

export default FavoriteBar
